require 'benchmark'

# @param {String} s
# @param {Integer} x
# @param {Integer} y
# @return {Integer}
def maximum_gain(s, x, y)
  gain = 0
  str = s
  part1, score1, part2, score2 = x > y ? ['ab', x, 'ba', y] : ['ba', y, 'ab', x]
  iter_count = 0
  loop do
    loop do
      str, del_flag = del_sub(str, part1)
      if del_flag
        iter_count = 0
        gain += score1
      else
        iter_count += 1
        break
      end
    end
    break if iter_count > 1

    loop do
      str, del_flag = del_sub(str, part2)
      if del_flag
        iter_count = 0
        gain += score2
      else
        iter_count += 1
        break
      end
    end
    break if iter_count > 1
  end
  gain
end

def del_sub(s, sub_str)
  str = s.sub(sub_str, '')
  [str, str != s]
end

s = 'cdbcbbaaabab'
x = 4
y = 5
puts maximum_gain(s, x, y)
s = 'aabbaaxybbaabb'
x = 5
y = 4
puts maximum_gain(s, x, y)
s = ''
x = 9150
y = 6050
bench = Benchmark.measure {
  puts maximum_gain(s, x, y) # 174833650
}
puts bench.real # 0.5665964190011437
